import React from "react";
import Allblogs from "./Allblogs";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="">
            <Allblogs />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
